export default function ProductButtonBar(props) {
    const [showButtons, setShowButtons] = useState()
    
    return(
        <div className={"form__buttonWrapper active" + (showButtons ? ' active' : '')}>
            <div className="form__buttonTitle heading">Unsaved product</div>
            <div className="form__buttons">
                <button type="submit" className="btn btn__primary">Save</button>
            </div>
        </div>
    )
}
